import Option from "./Option";

export default function Options({ isRepaymentSelected, isInterestSelected }) {
  return (
    <div className="form-group options">
      <div>
        <label>Mortgage Type</label>
        <Option isSelected={isRepaymentSelected} id="repayment">
          Repayment
        </Option>
        <Option isSelected={isInterestSelected} id="interest">
          Interest Only
        </Option>
      </div>
    </div>
  );
}
